import React from 'react';
import './backbutton.css';

const icon1 = require('./icon2.png')

const BackButton = ({onClick}) =>

        <div id="backicon" onClick={onClick}>
            <img src={icon1} />
        </div>;

function ButtonClick(){
    document.querySelector("#backicon img").style.opacity="50%";
}

BackButton.defaultProps = {
    onClick: ButtonClick
}

export default BackButton;
